import React from 'react';

export default function CharacterFiltersApplied(props) {
    const {filters} = props;

    return (
        <div>
            {
                Object.keys(filters || {}).map(filter => (
                    (filters[filter] || []).map(filter => filter ? <span>{filter}</span> : null)
                ))
            }
        </div>
    );
}
